/* Procedure structure for procedure `P_GET_PRODS_BY_NAMES` */

/*!50003 DROP PROCEDURE IF EXISTS  `P_GET_PRODS_BY_NAMES` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `P_GET_PRODS_BY_NAMES`(iN pname1 varchar(20),In pname2 VARCHAR(20))
BEGIN
                select pid,pname,price,quantity from products where pname IN(pname1,pname2);
	END */$$
DELIMITER ;

/* Procedure structure for procedure `P_GET_PROD_DETAILS_BY_ID` */

/*!50003 DROP PROCEDURE IF EXISTS  `P_GET_PROD_DETAILS_BY_ID` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `P_GET_PROD_DETAILS_BY_ID`(IN id INT,OUT name varchar(20),OUT cost INT,OUT qty INT)
BEGIN
	        SELECT pname,price,quantity INTO NAME,cost,qty FROM products where pid =id;

	END */$$
DELIMITER ;

